const Input = (props) => {
	return(
		<form onSubmit = {props.loadWeather}>
		<input type="text" name="city" placeholder="City"/>
		<input type="text" name="Country" placeholder="State"/>
		<button>Golf or nah?</button>
		</form>

		)
}

export default Input;
